import React from 'react';
import './index.css';

function SlotM(props){
    let {x, y, z} = props;
    if((x === y)&&(y === z)){
        return(
            <>
            <div>
                <h1>{x} {y} {z}</h1>
                <h1>This is Matching</h1>
            </div>
            </>
        );
    }
    else{
        return(
            <>
            <div>
                <h1>{x} {y} {z}</h1>
                <h1>This is Not Matching</h1>
            </div>
            </>
        );
    }
}

function App(){
    return (<>
        <h1 className='heading_style'> 🎰 Welcome to <span style={{fontWeight: 'bold'}}> Slot Machine game </span> 🎰 </h1>
        <SlotM x = '😊' y = '😊' z = '🐐'/>
        <SlotM x = '😊' y = '😊' z = '😊'/>
        <SlotM x = '😊' y = '😊' z = '🐐'/>
        <SlotM x = '😊' y = '😊' z = '🐐'/>
    </>);

}
export default App;
